create table attachment_rela
(
    id              bigint auto_increment
        primary key,
    attachment_id   bigint      null comment '附件ID',
    attachment_type int(10)     null comment '附件类型1：图片  2：发票',
    rela_id         bigint      null comment '关联ID',
    rela_type       varchar(64) null comment '关联类型',
    create_time     datetime    null,
    create_by       varchar(32) null,
    update_time     datetime    null,
    update_by       varchar(32) null
)
    charset = utf8;

